import axios from 'axios'

const baseURL = 'http://localhost/persons';

const getAll = () =>{
    return axios.get(baseURL)
}

const create = newContactObj => {
    return axios.post(baseURL, newContactObj)
}



export default {
    getAll: getAll,
    create: create
}
